import React from 'react';
import Menu from '../../components/menu/Menu';

const Layouts = () => {
  return (
    <div>
      <Menu /> {/* Renderizando o Menu importado */}
      <div>
        <h1>Conteúdo do Layout</h1>
        {/* Outros componentes e conteúdo */}
      </div>
    </div>
  );
};

export default Layouts;
